import './App.css';
import { Component } from 'react';
import Menu from './components/Menu';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import PageInicio from './components/PageInicio';
import PageDeportes from './components/PageDeportes';
import PageEquipos from './components/PageEquipos';
import PageEventos from './components/PageEventos';
import PageUsuarios from './components/PageUsuarios';

class App extends Component {


  render() {
    return (
      <>
        <Router>
        <Menu />
        <Routes>
          <Route path='/' ele={PageInicio} />
          <Route path='/PageInicio' component={PageInicio} />
          <Route path='/PageDeportes' component={PageDeportes} />
          <Route path='/PageEquipos' component={PageEquipos} />
          <Route path='/PageEventos' component={PageEventos} />
          <Route path='/PageUsuarios' component={PageUsuarios} />


        </Routes>
        </Router>

      </>
    );
  }
}

export default App;
